import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Todo Stream</h1>
        <hr />
        <p>This is your form area</p>
        <ul>
          <li>Todo #1</li>
          <li>Todo #2</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
